import React, { Component } from 'react';

class UsersTable extends Component {
    render() {
        return (
            <tr>
                <td>
                    {this.props.obj._Id}
                </td>
                <td>
                    {this.props.obj._num}
                </td>
                <td>
                    {this.props.obj._first_name}
                </td>
                <td>
                    {this.props.obj.last_name}
                </td>
                <td>
                    {this.props.obj.email}
                </td>
                <td>
                    {this.props.obj._Gender}
                </td>
                <td>
                    {this.props.obj._ip_address}
                </td>
            </tr>
        );
    }
}

export default UsersTable;
